import '../style/Header.css';
import Card from "react-bootstrap/Card";

export default class Weatherinput extends Component {
    render() {
        return (
            <div>
                <Card className="bg-info text-dark">
                    <Card.ImgOverlay>
                        <Card.Title >Weather Forcast App</Card.Title>
                        <Card.Text>
                            <h1>city Name </h1>
                        </Card.Text>
                    </Card.ImgOverlay>
                </Card>
            </div>
        )
    }
}
